import React from "react";
import { handleLogout } from "../../utils/Utils";

const LogoutButton = ({ token, setToken }) => {
  return (
    <button
      onClick={() => {
        handleLogout(token, setToken);
      }}
    >
      Logout
    </button>
  );
};

export default LogoutButton;
